import React, { Component } from "react";
import { Text, View } from "react-native";

export class SpanishOldTestament extends Component {
  render() {
    return (
      <View>
        <Text> El Antiguo Testamento </Text>
      </View>
    );
  }
}

export default SpanishOldTestament;
